import './App.css';
import Grid from './components/Grid.js'
import Navbar from './components/Navbar.js'
import {myGrid, makeMaze} from "./components/calc.js";
import {useState} from 'react';
import BoxClass from "./components/calc";

function App() {

  const [boxes, setBoxes] = useState([]);

  let tempArr = []
  for (let i = 0; i < 8; i++) {
    tempArr[i] = [];
    for (let j = 0; j < 8; j++) {
      boxes[i][j] = new BoxClass(i, j);
    }
  }


  return (
    <div className="App">
      <div className="content">
        <Navbar />
        <Grid boxes={boxes}/>
        <button onClick={() => makeMaze(boxes)}>Make Maze</button>
      </div>
    </div>
  );
}

export default App;
